    })
  }
    render() {
      if (!this.state.data) {
        return <div />
      }

      return (
        <div> 
          <ListGroup>
           {this.state.data.map(r => <ListGroupItem>{r}</ListGroupItem>)}     
          </ListGroup>;  
        </div>
      );
    }
  }

  export default ListComponent;
